import React from 'react'

function getCrews(crews) {
    if (crews) {
        let currentCrews = crews.map((crew, i) => {
            if (Object.entries(crew).length === 0) return
            let boat = "Undefined"
            return <div key={i} className="crew-item">{
                crew.members.map((member, j) => <p className="crew-member" key={j}>{member}</p>)

            }
                <p className="boat-item">{boat}</p>
            </div>
        })
    }

}

module.exports = getCrews
